Extensions: .ide Plugin name: IdeLoader.cleo The IDE loader transforms an item definition file (*.ide) that is widely used in GTA series games. The file is imported as an object where each key corresponds to a section in the file and the value is an array of array of strings: interface Ide { [key: string]: Array<Array<string>>;
} A first-level array represents a list of lines within this section in the file, and a second-level array represents a list of columns within that line. E.g. the following IDE file peds
0, null, generic, PLAYER1, STAT_PLAYER, player, 7f
1, cop, cop, COP, STAT_COP, man, 7f
end objs
170, grenade, generic, 1, 100, 0
end would be transformed into: { "peds": [ ["0", "null", "generic", "PLAYER1", "STAT_PLAYER", "player", "7f"], ["1", "cop", "cop", "COP", "STAT_COP", "man", "7f"] ], "objs": [ "170", "grenade", "generic", "1", "100", "0" ]
} Note that each data element becomes a string, even if it was a number in the original file. The loader does not make any assumption about specific sections, nor validate them. It follows a few simple rules where each section should start with an identifier ("peds", "objs") and end with the "end" string. It considers each line to be a comma- or space-separated set of columns that could be anything. // read data/default.ide file in the game directory
import data from "data/default.ide"; // read "peds" section from the file
const peds = data.peds; // find a line in the peds section where the second element (column) is "cop"
const cop = peds.find((line) => line[1] === "cop"); // if the line is found print the model id from the first column
if (cop) { log("Cop model ID is " + parseInt(cop[0]));
} else { log("Model with the name 'cop' not found");
} This script shows how you can use .find and other common array methods to find a line in the imported IDE file and use it. It prints 1 when given a file with the content shown above.

