Opcodes from CLEO Library (CLEO 4 or CLEO for GTA III and Vice City) are not supported. But CLEO Redux adds its own new opcodes for some operations. 0C00 IS_KEY_PRESSED 0C01 INT_ADD 0C02 INT_SUB 0C03 INT_MUL 0C04 INT_DIV 0C05 TERMINATE_THIS_CUSTOM_SCRIPT 0C06 WRITE_MEMORY ( UNSAFE - requires mem permission) 0C07 READ_MEMORY ( UNSAFE - requires mem permission) 0C08 CALL_FUNCTION ( UNSAFE - requires mem permission) 0C09 CALL_FUNCTION_RETURN ( UNSAFE - requires mem permission) Note that Sanny Builder does not support these new opcodes out-of-the-box yet. To enable new opcodes in your CS scripts add the following lines on top of your script: {$O 0C00=1, is_key_pressed %1d% }
{$O 0C01=3,%3d% = %1d% + %2d% }
{$O 0C02=3,%3d% = %1d% - %2d% }
{$O 0C03=3,%3d% = %1d% * %2d% }
{$O 0C04=3,%3d% = %1d% / %2d% }
{$O 0C05=0,terminate_this_custom_script }
{$O 0C06=5,write_memory %1d% size %2d% value %3d% virtual_protect %4d% ib %5d% }
{$O 0C07=5,%5d% = read_memory %1d% size %2d% virtual_protect %3d% ib %4d% }
{$O 0C08=-1,call_function %1d% ib %2d% num_params %3d%}
{$O 0C09=-1,call_function_return %1d% ib %2d% num_params %3d%} This list might not be complete as there are custom plugins with extra commands (see Using SDK ). Refer to Sanny Builder Library for the complete list of available commands for each game.

