The host can start the runtime and advance its main loop using SDK methods RuntimeInit and RuntimeNextTick. This option is suitable if you have control over the host's source code and can execute arbitrary instructions. This is how it can be implemented in Rust: [dependencies]
ctor = "0.1.21"
cleo_redux_sdk = "^0.0.6" use std::time;
use ctor::*;
use cleo_redux_sdk; #[cfg_attr(target_arch = "x86", link(name = "cleo_redux"))]
#[cfg_attr(target_arch = "x86_64", link(name = "cleo_redux64"))] #[ctor]
fn init() { use std::thread; // load CLEO scripts, FXT, enable file watcher cleo_redux_sdk::runtime_init(); // init time variables const FPS: i32 = 30; let time_step = 1000 / FPS; let started = time::Instant::now(); thread::spawn(move || loop { let current_time = started.elapsed().as_millis() as u32; // advance main loop providing current time and time step // current time is used to determine whether a script should "wake up" after wait command // time step is used to increment TIMERA and TIMERB variables cleo_redux_sdk::runtime_next_tick(current_time, time_step); // pause for at least time step ms thread::sleep(time::Duration::from_millis(time_step as u64)); });
}
